	li $s1, PLAYER_START_Y
	li $s2, 0
	li $s3, 1
	li $s4, 1
	li $s5, 1
	li $s6, 3
	
#Main loop: Keyboard, on platform, locations, collision, update states, erase and redraw, sleep
 main_loop:
 #store prev pos
	la $a0, prev_x_pos
	move $t0, $s0
	sw $t0, 0($a0)
	
	la $a0, prev_y_pos
	move $t0, $s1
	sw $t0, 0($a0)
     
 #Check states
  	jal check_keypress
  	jal update_gravity
  	jal enemy1_loop
  	jal check_enemy1_collision
	jal enemy2_loop
	jal check_bullet
  	jal check_enemy2_collision
