  	jal check_win

 #print pos	
 	jal erase_character
 	jal print_character
 	jal print_trophy
 	jal print_enemy2loop

 #sleep 
        li $v0, 32 
	li $a0, SLEEP
	syscall
	
# loop main
        j main_loop
        
check_keypress:
	li $t9, 0xFFFF0000         
         lw $t8, 0($t9)              
         beq $t8, 1, keypress_happened  
	jr $ra
	
keypress_happened:
         lw $t2, 4($t9)          
        
         beq $t2, 0x61, input_a      
         beq $t2, 0x77, input_w      
	beq $t2, 0x64, input_d     
	beq $t2, 0x71, quit
	beq $t2, 0x72, Clear_screen
	
	jr $ra

input_a:
	beq $s0, 1, no_update
	subi $s0, $s0, 1      

	jr $ra

input_d:
	beq $s0, 125, no_update
	addi $s0, $s0, 1

	jr $ra

input_w: #check if on platfrom or floor y level
	beq $s1, 58, jump
	beq $s1, 46, check_jump_platform
	beq $s3, 1, double_jump
	jr $ra
	
check_jump_platform: #t2: xpos
	blt  $t2, 21, jump 
	bgt $t2, 107, jump
	beq $s3, 1, double_jump
	jr $ra
	
no_update:
	jr $ra
	
jump:
	beq $s1, 51, check_jump_ceiling
	li $s2, 10
	subi $s1, $s1, 1

	jr $ra
	
check_jump_ceiling:
	blt  $t2, 21, fall 
	bgt $t2, 107,fall
	li $s2, 10
	subi $s1, $s1, 2 

	jr $ra
	
update_gravity: #t0: y pos, t1: vertical vel, t2: x pos
	move $t0, $s1
	move $t1, $s2
	move $t2, $s0
	
	#check if on platforms
	blt  $t2, 21, check_y_fall 
	bgt $t2, 107, check_y_fall
    	beq $t0, 58, reset_double_jump
    	j fall
    	
reset_double_jump:
	li $s3, 1
	jr $ra
	
check_y_fall:
	beq $t0, 46, reset_double_jump
	beq $t0, 58, reset_double_jump
	j fall
	
fall:
	bgtz $s2, up
	addi $s1, $s1, 1
	jr $ra
	
up:
	beq $t0, 51, check_x_up
	subi $s1, $s1, 1
	subi $s2, $s2, 1
	jr $ra
	
check_x_up:
	blt  $t2, 21, head_ceiling
	bgt $t2, 107, head_ceiling
	subi $s1, $s1, 1
	subi $s2, $s2, 1
	jr $ra

